class CameControl:
    def __init__(self):
        self.proc = None
        self.restart()

    def restart(self):
        if self.proc != None:
            self.proc.close()

        self.proc = remote('54.85.45.101', 8006)
        self.board = None
        self.score = 0
        self.status = "running"
        self.update()

    def update(self):
        board = self.proc.recvuntil(b"\n\n", drop=True)
        self.board = [list(map(_from_val, row.split())) for row in board.decode().strip().split("\n")]
        status = self.proc.recv().decode().strip()
        if 'Enter command' in status:
            self.status = 'running'
        elif 'Game Over' in status:
            self.status = 'ended'
        else:
            self.status = 'won'
            print(status)

    def get_board(self):
        return self.board

    def get_status(self):
        return self.status

    def execute_move(self, move):
        self.proc.sendline(movekey(move))
        self.update()

    def get_highest(self):
        return max(max(row) for row in to_val(self.board))
